module.exports.fromXMLTest = (test) => {
  let danfe
  let html
  const expectedNumero = '<div>Nº 1054</div>'

  // fromXML
  danfe = fromXML(xml, 1036)
  test.ok(danfe.toHtml())

  // fromNFe
  danfe = fromNFe(NFe(xml))
  html = danfe.toHtml()
  test.ok(html)
  test.ok(html.indexOf(expectedNumero) !== -1)

  // fromFile
  try {
    mkdirSync('tmp/')
  }
  catch (err) {
    console.error('Error on making directory => ' + err)
  }

  const pathTemp = mkdtempSync('tmp/d') + '/file.xml'
  writeFileSync(pathTemp, xml)
  danfe = fromFile(pathTemp, 1036)
  html = danfe.toHtml()
  test.ok(html)
  test.ok(html.indexOf(expectedNumero) !== -1)

  writeFileSync(pathTemp + '.html', html)

  test.done()
}